<?php\n$strCookies = 'Your cookie string here';\n\n// Extract sessionid value\npreg_match('/sessionid=([^,;]+)/', $strCookies, $sessionidMatches);\n$strSessionIDCookie = $sessionidMatches[1];\n\n// Extract cadata value\npreg_match('/cadata="([^"]+)"/', $strCookies, $cadataMatches);\n$strCADataCookie = $cadataMatches[1];\n\necho "Session ID: " . $strSessionIDCookie . "\n";\necho "CA Data: " . $strCADataCookie . "\n";\n?>